import styled from "@emotion/styled";

export const ProfileName = styled.div`
  font-weight: bold;
  font-size: 2rem;
`;

export const SumTime = styled.div``;

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  margin: 5rem 0rem 0rem 10rem;
`;
